	CONSTRAINT `receta_ibfk_5` FOREIGN KEY (`id_pac`) REFERENCES `pacientes` (`id_pac`)   ON UPDATE CASCADE ON DELETE CASCADE,
	INDEX `cla_pac_fk` (`id_pac`) comment '',
	INDEX `cla_med_fk` (`cedula`) comment '',
	INDEX `id_rec` (`id_rec`) comment '',
	INDEX `recetafk4` (`id_usu`) comment '',
	INDEX `recetafk` (`id_tip`) comment '',
	INDEX `receta_ibfk_6` (`id_ser`) comment ''
) ENGINE=`InnoDB` AUTO_INCREMENT=207 DEFAULT CHARACTER SET latin1 COLLATE latin1_swedish_ci ROW_FORMAT=COMPACT COMMENT='InnoDB free: 93184 kB; (`id_tip`) REFER `receta_electronica/' CHECKSUM=0 DELAY_KEY_WRITE=0;

