-- ----------------------------
--  View structure for `existencias`
-- ----------------------------
DROP VIEW IF EXISTS `existencias`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `existencias` AS (select `p`.`cla_pro` AS `cla_pro`,`p`.`des_pro` AS `des_pro`,`dp`.`lot_pro` AS `lot_pro`,`dp`.`cad_pro` AS `cad_pro`,`dp`.`id_ori` AS `id_ori`,`i`.`cant` AS `cant` from ((`productos` `p` join `detalle_productos` `dp`) join `inventario` `i`) where ((`p`.`cla_pro` = `dp`.`cla_pro`) and (`dp`.`det_pro` = `i`.`det_pro`)));

-- ----------------------------
--  View structure for `recetas`
