DROP VIEW IF EXISTS `recetas`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `recetas` AS (select `dr`.`fol_det` AS `fol_det`,`r`.`fol_rec` AS `fol_rec`,`p`.`nom_com` AS `nom_com`,`r`.`fecha_hora` AS `fecha_hora`,`pr`.`cla_pro` AS `cla_pro`,`pr`.`des_pro` AS `des_pro`,`dr`.`can_sol` AS `can_sol`,`dr`.`cant_sur` AS `cant_sur`,`r`.`transito` AS `transito`,`r`.`id_rec` AS `id_rec`,`r`.`baja` AS `baja`,`dr`.`indicaciones` AS `indicaciones`,`m`.`nom_com` AS `medico` from (((((`receta` `r` join `pacientes` `p`) join `detreceta` `dr`) join `detalle_productos` `dp`) join `productos` `pr`) join `medicos` `m`) where ((`p`.`id_pac` = `r`.`id_pac`) and (`r`.`id_rec` = `dr`.`id_rec`) and (`dr`.`det_pro` = `dp`.`det_pro`) and (`dp`.`cla_pro` = `pr`.`cla_pro`) and (`r`.`cedula` = `m`.`cedula`)));

