--  View structure for `salidas`
-- ----------------------------
DROP VIEW IF EXISTS `salidas`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `salidas` AS (select `dr`.`fol_det` AS `fol_det`,`dp`.`det_pro` AS `det_pro`,`dr`.`can_sol` AS `can_sol`,`dr`.`cant_sur` AS `cant_sur`,`i`.`id_inv` AS `id_inv`,`i`.`cant` AS `cant`,`dr`.`id_rec` AS `id_rec` from ((`detreceta` `dr` join `detalle_productos` `dp`) join `inventario` `i`) where ((`dr`.`det_pro` = `dp`.`det_pro`) and (`dp`.`det_pro` = `i`.`det_pro`)));

SET FOREIGN_KEY_CHECKS = 1;
